    const handleChange = (e) => setValue(e.target.value);
    return (
        <div>
        <TextField onChange={handleChange}
            required
            id={_p1}
            label={_p1}
            variant="outlined"
            type="number"
            autoComplete="current-password"
        />
        </div>
    )
}
